G11 Halogén Free Seuneu Retardant Hard Epoxy Glassfiber Laminated Lambaran
Panjelasan Produk
Produk ieu dijieun kalayan lawon serat kaca non-alkali tukang listrik salaku bahan Nyieun, kalawan résin epoxy TG tinggi sakumaha map via mencét panas laminated handapeun 155 temperature temperature.It boga kakuatan mékanis tinggi dina suhu normal, masih boga kakuatan mékanis kuat, alus. sipat listrik dina lingkungan garing sarta baseuh, bisa dipaké dina lingkungan beueus sarta trafo oil.It milik kelas F lalawanan panas insulating material.The data teknis sarupa FR5, tapi teu retardant seuneu.
Patuh sareng Standar
Luyu sareng GB / T 1303.4-2009 résin térmosét listrik laminates keras industri - Bagian 4: Laminasi keras résin epoksi, bahan insulasi IEC 60893-3-2-2011 - résin térmosét listrik laminat keras industri - Bagian 3-2 tina bahan individu spésifikasi EPGC203.
Fitur
stabilitas listrik 1.High handapeun kalembaban tinggi;
2.Excellent sipat mékanis;
kakuatan mékanis 3.High dina suhu luhur;
lalawanan 4.High Uap;
lalawanan panas 5.High;
6. Résistansi suhu: Kelas F
Aplikasi
Lumaku pikeun sagala jinis motor, listrik, éléktronik jeung widang séjénna, loba dipaké dina motor, alat-alat listrik salaku bagian struktur insulasi, switchgear tegangan tinggi, switch tegangan tinggi (kayaning bahan insulasi stator motor dina duanana tungtung, rotor tungtung plat rotor flange sapotong. , slot ngaganjel, plat wiring, jsb).

